var selected_persona = null;

function change_persona() {
	// change to a random persona, display it and reset message history
	selected_persona = all_personas[Math.floor(Math.random() * all_personas.length)];
	var display_text =  postprocess(selected_persona)
	
	// add new line after every '.' char
	display_text = display_text.replace( /\./g, ".<br />");
	$(".persona-text").html(display_text);
	
	$('.messages').empty();
}

function postprocess(string) {
	// remove spaces before punctation, 
	// capatalise after punctuation
	// capatalise 'i'
	string = string.replace(/\s+(\W)/g, "$1");
	
	let re = /(^|[.!?]\s+)([a-z])/g;
	string = string.replace(re, (m, $1, $2) => $1 + $2.toUpperCase());
	
	string = string.replace(/ i /g, " I ");
	return string
}

$(document).ready(function(){
	change_persona();
	$(".persona-change").click(change_persona);
	
	// drop down menu to select model
	$(".custom-select").each(function() {
	  var classes = $(this).attr("class"),
		  id      = $(this).attr("id"),
		  name    = $(this).attr("name");
	  var template =  '<div class="' + classes + '">';
		  template += '<span id="model-to-use" class="custom-select-trigger">' + $(this).attr("placeholder") + '</span>';
		  template += '<div class="custom-options">';
		  $(this).find("option").each(function() {
			template += '<span class="custom-option ' + $(this).attr("class") + '" data-value="' + $(this).attr("value") + '">' + $(this).html() + '</span>';
		  });
	  template += '</div></div>';
	  
	  $(this).wrap('<div class="custom-select-wrapper"></div>');
	  $(this).hide();
	  $(this).after(template);
	});
	$(".custom-option:first-of-type").hover(function() {
	  $(this).parents(".custom-options").addClass("option-hover");
	}, function() {
	  $(this).parents(".custom-options").removeClass("option-hover");
	});
	$(".custom-select-trigger").on("click", function() {
	  $('html').one('click',function() {
		$(".custom-select").removeClass("opened");
	  });
	  $(this).parents(".custom-select").toggleClass("opened");
	  event.stopPropagation();
	});
	$(".custom-option").on("click", function() {
      $('.messages').empty();
	  $(this).parents(".custom-select-wrapper").find("select").val($(this).data("value"));
	  $(this).parents(".custom-options").find(".custom-option").removeClass("selection");
	  $(this).addClass("selection");
	  $(this).parents(".custom-select").removeClass("opened");
	  $(this).parents(".custom-select").find(".custom-select-trigger").text($(this).text());
	});
	
	
	// message form handler, POST message and get reply
	$("#message-form").submit(function(event) {
		var message = $(".enter-message").val().trim();
		var reply = "";
		
		$(".enter-message").val('');
		if (message != "") {
			// display user message
			var elem = '<div class="message from-user">' +
					   '<div class=message-box>' + message +
					   '</div></div>';
			$('.messages').append(elem);
			
			
			// display typing animation
			elem = '<div class="message typing-indicator">' +
				   '<span></span>' +
				   '<span></span>' +
				   '<span></span></div>';
			$('.messages').append(elem);
			
			$(".messages").animate({ scrollTop: $('.messages').prop("scrollHeight")}, 1000);
			
			// get reply using ajax
			var modelName = $('#model-to-use').text();
			if (modelName == "Transformer") {
				modelName = "transformer";
			} else if (modelName == "Seq2Seq") {
				modelName = "seq2seq";
			} else {
				modelName = "multiple";
			}
			
			$.getJSON($SCRIPT_ROOT + '/_get_reply', {
				model_name : modelName,
				message : message,
				persona : selected_persona
			}, function(data) {
				
				// remove typing animation
				$('.typing-indicator').remove();
				
				// display reply
				elem = '<div class="message from-bot">' +
					   '<div class=message-box>' + data.result +
					   '</div></div>';
				$('.messages').append(elem);
				
				
			});
		}
		
		event.preventDefault();
	});
});